import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [
    {id: 'e1', title: 'Car Insurance', amount: 198.67, date: new Date(2021, 2, 28)},
    {id: 'e2', title: 'Internet Bill', amount: 300.00, date: new Date(2021, 6, 19)}
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem expenses={expenses.map((expense) => {
        console.log("-->"+expense.title);
        return expense;
      })}/>
    </div>
  );
}

export default App;
